import React from 'react'

import './InputPrompt.scss'

export default class InputPrompt extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            operation: this.props.operation
        }
    }

    render() {
        return (
            <>
                <div id='prompt-background'>
                    <div id='input-container'>

                    </div>
                </div>
            </>
        );
    }
}
